import './BoutiqueMenu.css'
import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { fetchBonnet } from "../../redux/products/productsReducer";
import { fetchTourDeCou } from "../../redux/products/productsReducer";
import { fetchPull } from "../../redux/products/productsReducer";
import { fetchGant } from "../../redux/products/productsReducer";
import { fetchChaussette } from "../../redux/products/productsReducer";
import { fetchChausson } from "../../redux/products/productsReducer";
import { fetchPlaide } from "../../redux/products/productsReducer";
import { fetchPelote } from "../../redux/products/productsReducer";

export default function BoutiqueMenu() {


const dispatch = useDispatch()

 const productsBonnet = () =>{
   dispatch(fetchBonnet())
 }
 const productsTourDeCou = () =>{
   dispatch(fetchTourDeCou())
 }
 const productsPull = () =>{
   dispatch(fetchPull())
 }
 const productsGant = () =>{
   dispatch(fetchGant())
 }
 const productsChaussette = () =>{
   dispatch(fetchChaussette())
 }
 const productsChausson = () =>{
   dispatch(fetchChausson())
 }
 const productsPlaide = () =>{
   dispatch(fetchPlaide())
 }
 const productsPelote = () =>{
   dispatch(fetchPelote())
 }


  return (
      <div className="container-boutique-menu">
        <div className="item" onClick={productsBonnet}>Tour de cou </div>
        <div className="item" onClick={productsTourDeCou}>Tour de cou </div>
        <div className="item" onClick={productsPull}>Pull </div>
        <div className="item" onClick={productsGant}>Gant </div>
        <div className="item" onClick={productsChaussette}>Chaussette </div>
        <div className="item" onClick={productsChausson}>Chausson </div>
        <div className="item" onClick={productsPlaide}>Plaide  </div>
        <div className="item" onClick={productsPelote}>Pelote </div> 
      </div>
  );
}
